import React from 'react';
import Layout from "../../_layouts/default/Layout";
import {useStyles} from "./NotFound.style";


const NotFound = () => {
    const classes = useStyles()

    return (
        <Layout>
            <canvas id="canvas" hidden />
            <div className="center">
                <h1>404</h1>

                <p>PAGE NOT FOUND.</p>
            </div>
        </Layout>
    );
}

export default NotFound
